import React from 'react';
import Menus from './Menus';

function SearchList({ menu }) {
  const filtered = menus.map(menu=>  <Menu key={menu.nama} person={menu} />); 
  return (
    <div>
      {filtered}
    </div>
  );
}

export default SearchList
